import React from 'react';
import { Checkbox, Table } from 'antd';

const TableQuestions = ({
  calendarData , onSelectAll, onSelectOne, selectAll, selectedCatIds,editModalOnClick}) => {
  const columns = [
    {
      title: 'Name',
      dataIndex: 'exam_name',
      width: '10%',
    },
    {
      title: 'Notification Date',
      dataIndex: 'notification_Date',
      width: '10%',
    },
    {
      title: 'Examination Date',
      dataIndex: 'examination_Date',
      width: '10%',
    },
    {
      title: 'Position',
      dataIndex: 'exam_pos',
      width: '10%',
    },
    {
      title: 'Edit',
      dataIndex: 'edit',
      align: 'center',
      width: '5%',
    },
    {
      title: <Checkbox checked={selectAll} onClick={(e) => onSelectAll(e.target.checked)}></Checkbox>,
      dataIndex: 'check',
      width: '2%',
    }
  ];
  console.log(calendarData,"wewe")
  let data = calendarData.map(a => {
    
    let obj = {
      key: a.exam_id,
      exam_name:a.exam_name,
      notification_Date:a.notification_Date,
      examination_Date:a.examination_Date,
      exam_pos:a.exam_pos,
      
      edit: (
        console.log("qwertyu"),
        <i className="fas fa-pen" onClick={() => editModalOnClick(a)} style={{ cursor: 'pointer' }}></i>
      ),
      check: (
        <Checkbox
          onClick={() => onSelectOne(a.exam_id)}
          checked={selectedCatIds.indexOf(a.exam_id) >= 0}
        />
      ),
    }
    console.log(obj,"qqqqqqqqqq123")
    return (obj);
  });

  return (
    <div>
      <div>
        <Table columns={columns} dataSource={data} pagination={false} bordered />
      </div>
    </div>
  );
};

export default TableQuestions;
